import React from 'react'
import Head from 'next/head';
import ListingWrapper, {
    CheckVisaWrapper,
    BreadcrumbWrapper
} from 'container/Listing/Listing.style';
import { SelectBreadcrumb, Divider } from 'antd';
import CheckVisaItem from 'components/CheckVisa/CheckVisa';


export default function CheckVisa() {
    return (
        <ListingWrapper>
            <Head>
                <title>Kiểm tra tỉ lệ đậu visa</title>
            </Head>
            <BreadcrumbWrapper>
                <Breadcrumb>
                    <Breadcrumb.Item href="/">
                        <span>Trang chủ</span>
                    </Breadcrumb.Item>
                    <Breadcrumb.Item href="/blog">
                        <span>Kiểm tra tỉ lệ đậu visa</span>
                    </Breadcrumb.Item>
                </Breadcrumb>
                <Divider />
            </BreadcrumbWrapper>
            <CheckVisaWrapper>
                <CheckVisaItem 
                    question='Câu 1'
                    
                />
            </CheckVisaWrapper>
        </ListingWrapper>
    )
}
